/*
*	GB2312和GBK每一个汉字由2个字节组成，这2个字节的ASCII码大小分别是：
	gb2312: high8 = 0xa1-->0xfe 
			low8 = 0xa1-->0xfe 

	gbk: high8 = 0x80-->0xfe 
	 	 low8 = 0x40-->0xfe

*	汉字库是按照区位的顺序排列的，前一个字节为该汉字的区号，后一个字节为该字的位号。
	每一个区记录 94 个汉字，位号则为该字在该区中的位置。因此，汉字在汉字库中的具体位置计算公式为：94*(区号-1)+位号-1。减 1 是因为数组是以 0 为开始而区号位号是以 1 为开
	始的。只需乘上一个汉字字模占用的字节数即可，即：(94*(区号-1)+位号-1)*一个汉字字模
	占用字节数

    对于gb2312 区号= 高字节-a0 
	           位号= 低字节-a0	(1--94)

    对于gbk    区号= 高字节-80
	           位号= 低字节-80

*/
